using namespace std;

// custom comparator: https://www.geeksforgeeks.org/sort-c-stl/
bool comparator(vector<int>& v1, vector<int>& v2) {
    return (v1[1] < v2[1]);  // sort by descending order of end time
}

class Solution {
   private:
    bool debug = false;

    // unused method
    vector<vector<int>> dedup(vector<vector<int>>& sortedVec) {
        vector<vector<int>> dedupedVec;

        for (int i = 0; i < sortedVec.size(); i++) {
            if ((i == 0) || (sortedVec[i] != sortedVec[i - 1])) {
                dedupedVec.push_back(sortedVec[i]);
            }
        }

        return dedupedVec;
    }

    // unused method
    vector<int> buildNgeIdxRight(vector<vector<int>>& vec) {
        int len = vec.size();

        vector<int> ngeIdxRight(len, len);
        stack<int> stk;
        for (int i = len - 1; i >= 0; i--) {
            int crrVal = vec[i][0];

            while (!stk.empty() && (vec[stk.top()][0] <= crrVal)) {
                stk.pop();
            }

            if (!stk.empty()) {
                ngeIdxRight[i] = stk.top();
            }

            stk.push(i);
        }

        return ngeIdxRight;
    }

    void showVec(vector<vector<int>>& vec) {
        printf("\nevents vec is:-\n");

        printf("Idx:\t");
        for (int i = 0; i < vec.size(); i++) {
            printf("[%d]\t", i);
        }
        cout << endl;

        printf("Start:\t");
        for (int i = 0; i < vec.size(); i++) {
            printf("%d\t", vec[i][0]);
        }
        cout << endl;

        printf("End:\t");
        for (int i = 0; i < vec.size(); i++) {
            printf("%d\t", vec[i][1]);
        }
        cout << endl;

        printf("Val:\t");
        for (int i = 0; i < vec.size(); i++) {
            printf("%d\t", vec[i][2]);
        }
        cout << endl;
    }

    void showVec(vector<int>& vec, string name) {
        printf("\n%s vec is:-\n", name.c_str());

        printf("Idx:\t");
        for (int i = 0; i < vec.size(); i++) {
            printf("[%d]\t", i);
        }
        cout << endl;

        printf("Val:\t");
        for (int i = 0; i < vec.size(); i++) {
            printf("%d\t", vec[i]);
        }
        cout << endl;
    }

    vector<int> buildPrefixMaxVec(vector<vector<int>>& vec) {
        int len = vec.size();

        vector<int> prefixMaxVec(len, -1);
        int crrMax = -1;
        for (int i = 0; i < len; i++) {
            crrMax = max(crrMax, vec[i][2]);
            prefixMaxVec[i] = crrMax;
        }

        return prefixMaxVec;
    }

    vector<int> buildPrevEndTimeIdxVec(vector<vector<int>>& vec) {
        int len = vec.size();
        vector<int> prevEndTimeIdxVec(len, -1);

        int prevEndTime = -1;
        int prevEndTimeIdx = -1;
        for (int i = 1; i < vec.size(); i++) {
            if (vec[i - 1][1] == vec[i][1]) {
                prevEndTimeIdxVec[i] = prevEndTimeIdxVec[i - 1];
            } else {
                prevEndTimeIdxVec[i] = i - 1;
            }
        }

        return prevEndTimeIdxVec;
    }

    int binSearchUpperBoundIdx(vector<vector<int>>& vec, int lo, int hi, int maxEndTime) {
        int crrLen = hi - lo + 1;
        if (crrLen <= 0) {
            return -1;
        }
        if (crrLen == 1) {
            if (vec[lo][1] <= maxEndTime) {
                return lo;
            } else {
                return -1;
            }
        }

        int mid = (lo + hi) / 2;
        int midEndTime = vec[mid][1];

        if (midEndTime > maxEndTime) {
            return binSearchUpperBoundIdx(vec, lo, mid - 1, maxEndTime);
        } else {
            return max(mid, binSearchUpperBoundIdx(vec, mid + 1, hi, maxEndTime));
        }
    }

    int findOverallMaxTotalValue(
        vector<vector<int>>& sortedEvents,
        vector<int>& prefixMaxVec,
        vector<int>& prevEndTimeIdxVec) {
        int overallMaxTotalValue = sortedEvents[0][2];  // initialize with case where we pick first val
        for (int i = 1; i < sortedEvents.size(); i++) {
            if (debug) {
                printf("\n---------\n\n");
                printf("at i=%d, (%d, %d) -> %d\n\n", i, sortedEvents[i][0], sortedEvents[i][1], sortedEvents[i][2]);
            }

            // value obtained by picking current event
            int crrEventStartTime = sortedEvents[i][0];
            int crrEventValue = sortedEvents[i][2];

            // TIP: to avoid TLE, this linear search must be converted to binary search
            /*
            int prevEndTimeIdx = prevEndTimeIdxVec[i];
            while ((prevEndTimeIdx >= 0) && (sortedEvents[prevEndTimeIdx][1] >= crrEventStartTime)) {
                prevEndTimeIdx = prevEndTimeIdxVec[prevEndTimeIdx];
            }
            */

            // binary search implementation
            int prevEndTimeIdx = binSearchUpperBoundIdx(sortedEvents, 0, i - 1, crrEventStartTime - 1);

            // value obtained by picking max value non-overlapping event ending before the current event
            int maxPrevEventValue = 0;
            if (prevEndTimeIdx >= 0) {
                maxPrevEventValue = prefixMaxVec[prevEndTimeIdx];
                if (debug) {
                    printf("prevEndTimeIdx=%d, prevEndTime=%d, prevEndTimeMaxVal=%d\n", prevEndTimeIdx, sortedEvents[prevEndTimeIdx][1], maxPrevEventValue);
                }
            }

            // current total value
            int maxCrrTotalValue = maxPrevEventValue + crrEventValue;

            // overall maximum total value
            overallMaxTotalValue = max(overallMaxTotalValue, maxCrrTotalValue);
            if (debug) {
                printf("maxCrrTotalValue = crrValue=%d + maxPrevValue=%d = %d\n", crrEventValue, maxPrevEventValue, maxCrrTotalValue);
                printf("overallMaxTotalValue = %d\n", overallMaxTotalValue);
            }
        }

        return overallMaxTotalValue;
    }

   public:
    friend class SolutionTest;

    int maxTwoEvents(vector<vector<int>>& events) {
        // sorting with custom comparator: https://www.geeksforgeeks.org/sort-c-stl/
        sort(events.begin(), events.end(), comparator);
        if (debug) {
            showVec(events);
        }

        vector<int> prefixMaxVec = buildPrefixMaxVec(events);
        if (debug) {
            showVec(prefixMaxVec, "prefixMaxVec");
        }
        vector<int> prevEndTimeIdxVec = buildPrevEndTimeIdxVec(events);
        if (debug) {
            showVec(prevEndTimeIdxVec, "prevEndTimeIdxVec");
        }

        int overallMaxTotalValue = findOverallMaxTotalValue(events, prefixMaxVec, prevEndTimeIdxVec);
        if (debug) {
            printf("\noverallMaxTotalValue = %d\n\n", overallMaxTotalValue);
        }

        return overallMaxTotalValue;
    }
};

